export default withAuth(({isAuthorized,authorize, deauthorize}) =>
    <div className="App">
        <header className="App-header">
            <h2>Client page</h2>
            <button className='Button-style' onClick={deauthorize}>
                <Link to='/' className='Button-style' style={{textDecoration: 'none'}}>
                    Log Out
                </Link>
            </button>
        </header>
    </div>
);
